import Hero from "../compnents/Hero";
import Footer from "./components/Footer"

function Home () {
    return(
        <>
        <Hero 
        className='Hero'
        nImage='./assets/pfp.jpg'
        title='Your Journey to Diplomacy starts here'
        text = 'Choose your own path to Peace'
        url = '/register'
        buttonClass = 'hero-button'
        buttonName = 'Register'
        />
        <Footer/>
        </>
    )
}

export default Home;
